import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open Product Detail Modal
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('.category-card'); // Click on the first category card to open the modal
    await page.waitForSelector('.product-detail-info', { timeout: 5000 }); // Wait for the product detail to load

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail_modal.png'));

    return {
      success: true,
      action: "Opened the product detail modal",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
